  false,\n\t\"url\": null,\n\t\"notes\": \"This Comprehensive Conservation Plan (CCP)
  was written to guide management on Nestucca Bay National Wildlife Refuge for the
  next 15 years. This plan outlines the Refuge vision and purpose and describes how
  the Complex will contribute to the overall mission of the Refuge System. The plan
  provides an introduction to the Refuge, an overview of the CCP process, Refuge facilities
  and public use programs, goals and objectives, information about the management
  direction, and strategies for implementation.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
